import React, {Component} from 'react';
import style from './Navbar.module.css';
import Dialogs from '../Dialogs/Dialogs';
import { NavLink } from 'react-router-dom';
import profile from '../images/profile.jpeg';





const Navbar = () => {
    return (
        <nav className={style.Navbar}>
            <em className="firstmenu">
                <NavLink to="/Profile" activeClassName={style.activelink}><img src="../images/profile.jpeg" className={style.NavbarProfile}></img></NavLink>
            </em>
            <em className="firstmenu">
                <NavLink to="/Dialogs" activeClassName={style.activelink}><img src="../images/messages.png" className={style.NavbarMessages}></img></NavLink>
            </em>
            <em className="firstmenu">
                <NavLink to="/Group" activeClassName={style.activelink}><img src="../images/group.png" className={style.NavbarGroup}></img></NavLink>
            </em>
            <em className="firstmenu">
                <NavLink to="/News" activeClassName={style.activelink}><img src="../images/news.png" className={style.NavbarNews}></img></NavLink>
            </em>
            <em className="firstmenu">
                <NavLink to="/Settings" activeClassName={style.activelink}><img src="../images/settings.png" className={style.NavbarSettings}></img></NavLink>
            </em>

        </nav>
    );
}


export default Navbar;
